import React from 'react';
import ForgeViewerComponent from './ForgeViewerComponent'; // Ajusta la ruta según tu estructura de proyecto
import Footer from './Footer'; // Ajusta la ruta según tu estructura de proyecto

const ColumnaDerecha = ({ isCollapsed, token, urn }) => {
    const estiloColapsado = {
        width: '80%', // Ajusta según tus necesidades
    };

    const estiloExpandido = {
        width: '60%', // Ajusta según tus necesidades
    };

    const estiloActual = isCollapsed ? estiloColapsado : estiloExpandido;

    return (
        <div style={estiloActual}>
            {/* Aquí puedes incluir otro contenido si es necesario */}
            <ForgeViewerComponent token={token} urn={urn} />
            <Footer />
        </div>
    );
};

export default ColumnaDerecha;
